import React from 'react';
import { Link } from 'react-router-dom';

const buttonStyle = { backgroundColor: '#0e416c', borderColor: '#0e416c' };

function NavBar() {
  return (
    <nav className="nav">
      <Link to="/">
        <button className="btn btn-primary" style={buttonStyle}>
          Home
        </button>
      </Link>
      <br></br>
      <Link to="/movies">
        <button className="btn btn-primary" style={buttonStyle}>
          Movies
        </button>
      </Link>
      <br></br>
      <Link to="/podcasts">
        <button className="btn btn-primary" style={buttonStyle}>
          Podcasts
        </button>
      </Link>
    </nav>
  );
}

export default NavBar;
